import React, {Component} from 'react';
import './project.css';
import ImgMediaCard from './card';
import { Grid } from '@material-ui/core';

class Project extends Component{
    render(){
        return(
            <>
            <div className="proPage">
           <div className="heading">
               <h1>Project Page</h1>
               </div>
               <Grid container>
           <ImgMediaCard/>
           </Grid>
           </div>
           </>
        )
    }
}
export default Project;
